Franciscan inscription (followed by shelf mark): Pertinet ad locum Sargiani [...?]  L no. 21&quot;

Bodleian (See <a href="http://incunables.bodleian.ox.ac.uk/record/S-358" rel="nofollow">here</a>) has item with similar ownership inscription which has been transcribed as &quot;Pertinet ad locum Sargiani B[ ]t. no. 9' on [a2r]; also shelfmark ‘K no. 31&quot;
and attributed to Franciscans of Sargiano, Tuscany, near Arezzo.  Sargiano, which according to Bodleian incunable provenance, &quot;existed as a house of Observants until at least 1515; see Moorman, 438; Studi Franciscani, xiii (1915), 81-91; Il convento di Sargiano (Florence, 1947); for other books owned by Sargiano see CIBN (entry no) A-473; and BnF, Paris: Res. D. 6718; Res. D. 6720bis.&quot; 
Cf. <a href="http://incunables.bodleian.ox.ac.uk/provenance/record/3211?concise=no&amp;calling_page=browse" rel="nofollow">here</a>

